const App = () =>{

    return(
        <>

        <div className="main_box">
            <div className="card_box">

                <h1>0</h1>
                <div style={{ float : "left"}}><button>Increse</button></div>
                <div style={{ float : "right"}}><button>Decrese</button></div>

            </div>
        </div>

        </>
    );
};
export default App;
